{"0": ["Хорошая система для хранения мелочей, но 1400 дороговато", "2021-04-27T18:10:46Z", "красный", "0", 1, 0, 4, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "1": ["Отличная вещь, рекомендую, но одной мало!)", "2021-04-12T12:05:16Z", "красный", "0", 3, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "2": ["Класс.не пожалел.", "2021-04-11T08:39:13Z", "красный", "0", 3, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "3": ["Качественный, муж очень доволен", "2021-04-07T20:46:23Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "4": ["Отличный, под таблетки.. Ящики не большие но все поместилось.. Их подписали.. Где что и в тумбу на кухню убрали. Порядок плюс мало места занял", "2021-03-19T10:42:38Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "5": ["Начиталась отзывов, и решила- если будет какая-то упаковка странная, лопнувшие ячейки- даже брать не буду. Но- и это главное- ящичек пришел - корпус целый, внутри были вставлены все ящички, и весь комплект был обернут в пленку и запаян был, как на производстве. Это главный плюс. Ящички длинненькие, компактные , вместительные. Конечно, кг гвоздей класть нет смысла- не для этого ячейки. Но для наших целей- все подошло идеально. Ставлю 5 звезд! Сзади и по периметру решили укрепить перед навешиванием на стену. ", "2021-03-17T15:07:10Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "6": ["Беру второй, все устраивает", "2021-03-13T17:17:24Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "10": ["Замечательная вещь! Использую для хранения резинок и заколок. Можно повесить на стену. У ячеек есть небольшие стопы. В одну ячейку плотно входят три большие резинки. Рекомендую.", "2021-03-09T19:10:06Z", "красный", "0", 5, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "11": ["Отличный ящик. Все ячейки прекрасно открываются. Вместительный для мелочовки. Спасибо.", "2021-03-09T08:21:59Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "12": ["Ящики, когда других нет сойдут", "2021-03-07T17:18:13Z", "красный", "0", 0, 1, 4, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "21": ["Задумка хорошая, но качество отвратительное. Нижние стопоры под ящиками пришли россыпью в упаковке. Т.е. у большей части ящиков они даже без эксплуатации отвалились. От этого ящики стали криво стоять в окошках. Под наклейками обнаружилось, что 2 ящичка треснутые. В общем, хорошо, удобно. Но качество пластика отвратительное. Поэтому красная цена сей конструкции 500 руб.", "2021-02-20T09:53:43Z", "красный", "0", 1, 0, 2, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "22": ["За эту цену отличная система хранения, метизов и прочих мелочей. Пластик плотный, конструкция не хлипкая.", "2021-02-19T11:59:02Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "23": ["Отличный органайзер. Ящики вынимаются. При открывании до максимума поднимаешь на верх и потом вниз. Очень удобный.", "2021-02-13T05:45:13Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "27": ["Покупка оплачена и не получена в связи с отсутствием на складе, прошёл месяц не вернули деньги", "2021-01-22T17:01:23Z", "красный", "0", 1, 0, 1, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "28": ["Высота органайзера и ширина соответствуют. Сами ячейки маленькие. Можно положить болтики/гвоздики россыпью. В упаковке уже не войдут. Или например 1 -2 катушки ниток..При открывании ячеек, всегда отламываются и выпадают какие-то мелкие кусочки пластмассы. Хотя открываю аккуратно.. если органайзер не прибит к стене, а стоит на столе например, при открывании ячеек, его нужно поддерживать, а то вываливаются все ячейки и все содержимое рассыпается.", "2021-01-22T06:05:32Z", "красный", "0", 1, 2, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "29": ["Брала мужу на новый год. Он в восторге, перестал охотиться на баночки! Доставка быстрая, всё целое. Жду, когда появится в продаже, себе такой же взять. Рекомендую!", "2021-01-20T13:44:41Z", "красный", "0", 2, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "31": ["Прислали шуруповёрт рукожопы", "2021-01-08T11:49:16Z", "красный", "0", 1, 0, 1, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "32": ["На фото выглядит больше. В жизни поскромнее. Для гаража винтики/болтики/шурупчики = самое то", "2021-01-06T02:36:51Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "33": ["Товар классный, но неудачная транспортировка", "2020-12-15T15:13:24Z", "красный", "0", 3, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "35": ["Отличная система хранения!", "2021-01-01T17:56:38Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "36": ["Очень маленький и с повреждением , но не принципиально оставлю", "2020-12-30T12:47:09Z", "красный", "0", 0, 1, 2, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "39": ["Подарили свекру на Новый год, очень доволен, хотя сам оч привередлив к подаркам)", "2020-12-28T08:20:45Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "41": ["Товар оценить не могу, так как привезли шуруповерт вместо системы хранения.", "2020-12-27T21:15:10Z", "красный", "0", 3, 1, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "43": ["Не получила что хотела, прислали совсем не тот товар", "2020-12-26T17:03:09Z", "красный", "0", 1, 1, 1, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "45": ["Вместо заказанного ящика прислали черный кейс фирмы Deko. Отказалась от получения. Жду возврат денег. Такого товара на складе нет. Подарок отменился. Очень жаль.", "2020-12-26T12:15:49Z", "красный", "0", 1, 1, 1, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "46": ["Вместо данного органайзера прислали керамический горшок. Больше данного товара нет на складе. Теперь придется искать новый, т.к. данный товар планировался в качестве подарка", "2020-12-26T12:07:36Z", "красный", "0", 1, 1, 1, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "48": ["Соответствует описанию, но лучше брать жёлтый на больше ячеек. Много применений, буду заказывать ещё для ниток жене и родителям для лекарства", "2020-12-25T14:26:03Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "53": ["Отлично!!!", "2020-12-17T07:23:07Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "56": ["Возврат(повреждена)", "2020-12-14T11:38:59Z", "красный", "0", 1, 0, 3, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "57": ["Оценка 5!!!", "2020-12-14T11:09:50Z", "красный", "0", 0, 1, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "58": ["Ок. Все хорошо.", "2020-12-05T10:30:06Z", "красный", "0", 0, 2, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "60": ["Отличный ящик", "2020-12-07T19:02:58Z", "красный", "0", 0, 1, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "61": ["За товар ставлю 5звезд. Всё целое, нет никаких повреждений. Брала для ниток, но ячейки немного маловаты, жаль. Для  мелочей очень хорошо. Спасибо за быструю доставку", "2020-12-07T17:15:27Z", "красный", "0", 2, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "62": ["Всё пришло целое. Покупкой довольны, муж оценил. Будем наводить порядок в гараже, избавляться от баночек", "2020-12-06T10:55:13Z", "красный", "0", 2, 1, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "63": ["Отличный. Давно такой хотела, заказала под лекарства. Всё целое.", "2020-12-06T10:48:22Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "64": ["Ящик просто супер", "2020-12-05T15:40:09Z", "красный", "0", 0, 1, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "65": ["Пришел без одной ячейки. Возврат. Перезаказ.", "2020-12-05T07:26:34Z", "красный", "0", 0, 1, 3, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "66": ["Лоток бомба", "2020-11-30T15:29:32Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "67": ["Отличный ящик. Соответствует описанию . Тяжёлый, пластик крепкий.", "2020-11-26T11:20:53Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "69": ["Нет одной ячейки, возврат", "2020-11-26T10:17:03Z", "красный", "0", 0, 1, 1, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "71": ["Ну смысла фоткать я не вижу,фоток итак достаточно скинули.\nВсе как на картинке.Пришел менее чем за неделю.Подвесил на балконе.все мелочи убрал туда,освободив старые аптечки и выбросив их на свалку.приятный пластик.соглашусь,довольно вместительный,хоть я и привереда в размерах.\nЕдинственное опасался,что придет битый,читая отзывы.но нет...пронесло.покупайте ребята и девченки.вещь стоящая,даже презики можно прятать)))))шутка", "2020-11-17T19:56:37Z", "красный", "0", 5, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "75": ["Удобно для складывания мелочёвки", "2020-11-07T13:48:56Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "76": ["Рекомендую. Муж всякой мелочевки туда нафигачил😂", "2020-10-29T09:09:04Z", "красный", "0", 1, 1, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "77": ["Пришла в целости и сохранности! Не большая, но очень вместительная!!! Очень нужна вещь! Жаль, что в наш регион больше не доставляют... ", "2020-10-26T08:32:34Z", "красный", "0", 1, 1, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "78": ["Пришёл с одной треснутой ячейкой, меня это расстроило. ", "2020-10-26T08:29:46Z", "красный", "0", 0, 1, 2, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "80": ["Система хранения просто супер. Несмотря на небольшой размер умещается все и болтики и гаечки.", "2020-10-20T05:34:31Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "83": ["1 ящичек разбит. Жаль.", "2020-10-17T07:23:46Z", "красный", "0", 0, 1, 3, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "87": ["Очень удобный ящик. Заказали 4, но один пришел треснутый 😕. Всем советую!", "2020-10-10T17:11:34Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "90": ["Брать всем!", "2020-10-01T17:46:54Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "91": ["Поместились все машинки хот вилс!😄👍🚙🚛🚜🚀", "2020-09-30T08:35:39Z", "красный", "0", 7, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "93": ["Для 1000 мелочей). Гвоздики,шурупы,гайки,болты и т.п. Отвертки и т.п. не влезут)", "2020-09-26T11:43:11Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "94": ["Пришел в целости что очень обрадовало. Папе понравилась,полочки вместительны👍👍👍можно подвешивать, или просто убрать в шкаф👍", "2020-09-26T06:43:26Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "95": ["Отличный ящичек. Пластик жёсткий, устойчивый, в то же время эластичный. Буду заказывать ещё!!💙", "2020-09-25T15:36:18Z", "красный", "0", 0, 1, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "96": ["Пластик качественный, прочный. Для хранения мелочевки просто отличное решение. Брал в гараж, рассортировать болтик, гайки. Но обязательно возьму такой же домой. Ячейки довольно вместительные. Предусмотрен ограничитель, чтоб при вытягивании ячейка не выпала. Чтоб полностью вынуть, нужно в конце приподнять вверх. Если конечно сильнее дёрнуть все равно выскакивает. Вобщем я получил то что и ожидал.", "2020-07-21T14:52:36.333366274Z", "красный", "0", 32, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "98": ["Пришло все целым", "2020-09-20T11:54:08Z", "красный", "0", 2, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "99": ["Отличный ящик для хранения,крепкий.Рекомендую.", "2020-08-03T11:32:24.720806815Z", "красный", "0", 1, 0, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "100": ["Отличный ! Просто отличнейший органайзер!!!! Вписался см в см в мой шкаф. Использую для хранения насадок для пресса и кнопок с люверсами. Все можно подписать. Просто отличнейшая вещь.", "2020-05-19T14:01:23.846409525Z", "красный", "0", 5, 1, 5, "Система хранения 36 ячеек, 405х325х140", "DEKO"], "102": ["Ящик плохой\nНедовольны. Ящик пришёл в нетоварном виде: на поверхности были царапины и прочие механические повреждения, включая \"хвостики пластмассы\" как если бы его чем-то отсрым резануои по ребру. Помимо этого ещё и даже грязный, на фото видны разводы", "2020-07-16T04:56:21.925728887Z", "красный", "0", 4, 3, 2, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "105": ["Очень довольна покупкой, влезла вся мелочевка, покупайте не раздумывая.", "2020-07-11T09:48:30.889604361Z", "красный", "0", 3, 1, 5, "Система хранения 36 ячеек, 40,5х32,5х14 см", "DEKO"], "106": ["К сожалению, действующая в настоящий момент система работы Wildberries ставит в крайне невыгодные условия своих клиентов. Данный товар не был мной получен. В доставках значится как доставленный 09.07.2020. То есть, фактически, на каком-то этапе он украден, скорее всего на доставке. Так как товар мной уже оплачен, получается, что я потеряла свои деньги по вине недобросовестной работы сотрудников  Wildberries. Раньше можно было хотя бы  номер заказа указать в претензии, сейчас ни уведомлений магазина о подтверждении заказа, ни онлайн-чеков, когда он был оплачен. Обращаясь через сайт к операторам, получаешь шаблонные отписки, причем даже не по сути вопросов. Для обращений хотя бы в пункт доставки, чтобы самому разобраться в ситуации, отсутствуют контактные телефоны. Причем, это уже не в первый раз, когда именно этот курьер, указанный в доставке делает такое - самостоятельно отменяет доставку, когда ему не хочется ехать. И как доказать, что товар я не получила?", "2020-07-11T01:09:36.378939661Z", "красный", "0", 17, 1, 5, "Система хранен